import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="Contact">
      <img
        src="https://www.suzuki.com.vn/_next/image?url=https%3A%2F%2Fdoftr40680fkg.cloudfront.net%2Fassets%2Fimages%2FVIETNAM-PAGES%2Fcontact-us%2Fcontact_DeskBanner.jpg&w=2048&q=75"
        alt="hình hợp tác"
      />

      <div className="row">
        <div className="col-md-4">

        </div>
      </div>
    </div>
  );
}

export default Contact;
